.event, .dhx_cal_tab.active, .dhx_cal_tab.active:hover {background-color: rgb(130, 166, 130);} .dhx_month_head, .dhx_cal_tab, .dhx_cal_today_button {color: rgb(130, 166, 130);} .dhx_cal_tab, .dhx_cal_tab.active {border-color: rgb(130, 166, 130);}
.dhx_scale_holder_now, .dhx_now .dhx_month_head, .dhx_now .dhx_month_body { background-color: rgb(220, 230, 220);}
.event, .dhx_cal_tab_active {background:linear-gradient(167deg, rgba(150, 170, 150, 1) 28%, rgba(193, 219, 193, 1) 100%);border: none; border-radius:9px; height: 18px; display: block;}.dhx_cal_next_button {background-image: url("http://m.blog.hu/46/46os/skins/2020/img/arrow_r.png");background-size: 16px;right: 5px !important}.dhx_cal_prev_button {background-image: url("http://m.blog.hu/46/46os/skins/2020/img/arrow_l.png");background-size: 16px;right: 40px !important;}.dhx_agenda_line {margin-bottom: 5px;border-radius: 9px;color: white;}.dhx_agenda_area .dhx_agenda_line span {color:white;}.dhx_map_area .dhx_map_line .dhx_event_icon, .dhx_agenda_area .dhx_agenda_line .dhx_event_icon{background: url("http://m.blog.hu/46/46os/skins/2020/img/event.png") no-repeat center center;background-size: 16px;}.dhx_grid_area tr.dhx_grid_event, .dhx_map_line div.dhx_map_event_time, .dhx_agenda_line div.dhx_agenda_event_time {color: white;} .dhx_agenda_area .dhx_v_border {border-right: 1px solid white;}.dhx_cal_event_clear {color: white;}.month_tab {left: 5px !important;} .agenda_tab {left:  100px !important;}.dhx_cal_navline .dhx_cal_date  {left: auto;right: 80px;width: auto;} .dhx_cal_tab {background: linear-gradient(167deg, rgba(134, 150, 134, 1) 28%, rgba(173, 197, 173, 1) 100%);border-radius: 9px;border: none;font-weight: 400;box-shadow: 1px 1px 3px grey;color: white;} .dhx_cal_tab.active {border:none;text-decoration: underline;font-weight:400;} .dhx_cal_tab:hover { background: linear-gradient(167deg, rgba(150, 170, 150, 1) 28%, rgba(193, 219, 193, 1) 100%);    box-shadow: 1px 1px 2px grey;} .agenda_tab {background: linear-gradient(167deg, rgba(134, 150, 134, 1) 28%, rgba(173, 197, 173, 1) 100%);border-radius: 9px;border: 0px;font-weight: 400;box-shadow: 1px 1px 3px grey;color: white} .agenda_tab.active{border: none;font-weight: 400;text-decoration:underline;} .agenda_tab:hover { background: linear-gradient(167deg, rgba(150, 170, 150, 1) 28%, rgba(193, 219, 193, 1) 100%);    box-shadow: 1px 1px 2px grey;}.tooltip {visibility:hidden !important;} .icon_delete {visibility: hidden;}.dhx_cal_quick_info {background: white;border: none;border-radius: 15px;}.dhx_cal_qi_title { background: none; color: black;} .icon_details {visibility: hidden;}.dhx_cal_scale_placeholder{box-shadow: none;}
